const url= new URLSearchParams(window.location.search);
const id= url.get("id")
var item= null;
for (let i = 0; i < sach.length; i++) {
    const element = sach[i];
    if(element.id==id){
        item=element;
        break;
    }
}
const list=document.getElementById("body")
  const pHtml = `
      <div class="card">
            <img src="${item.img}"
                alt="">
            <div class="mota">
                <H1>${item.name}</H1>
                <p>S${item.des}</p>
                <p>${item.publiser}</p>
                <p style="color:green;">${item.status}</p>
                <div class="soluong">
                    <p id="t">-</p>
                    <p id="sl"> 1 </p>
                    <p id="c">+</p>
                </div>
                <div class="gia">
                    <p id="gt">${item.cost}</p>
                    <p>.000đ</p>
                </div>
                <button id="button">Thêm Vào Giỏ Hàng</button>
                <button id="button">Mua Ngay</button>
            </div>
        </div>
    `;
  list.innerHTML +=pHtml;
  var a = 1;
  var b = document.getElementById("sl")
  var c = document.getElementById("c")
  var t = document.getElementById("t")
  var gt = document.getElementById("gt")
  var d = 1;
  var e = document.getElementById("button")
  c.addEventListener("click", function () {
      a = a + 1
      b.innerText = a
      gt.innerText = a * item.cost
      d = a
  })
  t.addEventListener("click", function () {
      if (a > 1) { a = a - 1 }
      b.innerText = a
      gt.innerText = a * item.cost
      d = a
  })
  e.addEventListener("click", function () {
      alert("Thêm Vào Giỏ Hàng Thành Công")
  })